import React from 'react'
import { Pressable, StyleSheet, Text, View } from 'react-native'

const Button = () => {
    return (
        <Pressable style={styles.button}>
            <Text>Hello</Text>
        </Pressable>
    )
}

export default Button

const styles = StyleSheet.create({
    button: { 
        backgroundColor: 'red',
        marginBottom: 10,
        marginHorizontal: 10,
        paddingVertical: 10,

    }


})
